import React from "react";

function Register(props){
    const [data, setData] = React.useState(null);

    React.useEffect(() => {
        fetch(`http://localhost:3001/api/signup?username=${props.username}&password=${props.password}&email=${props.email}&firstName=${props.firstName}&lastName=${props.lastName}&dateOfBirth=${props.dateOfBirth}&contactNumber=${props.contactNumber}`)
            .then((res) => res.json())
            .then((data) => setData(data.message));
    }, []);

    alert(data.error);
}
export default Register;
